import React from 'react';
import Part from './Part';

const Content = ({ parts }) => {
  const partsList = parts.map(part => {
    return <Part part={part.title} exercise={part.exercises} />
  })

  return (
    <div>
      <Part part={parts[0].title} exercise={parts[0].exercises} />
      <Part part={parts[1].title} exercise={parts[1].exercises} />
      <Part part={parts[2].title} exercise={parts[2].exercises} />     
    </div>
  )
}

export default Content;
